// TableVisualization.js
import React from "react";
import PropTypes from "prop-types";

const TableVisualization = ({
  graphData,
  handleLabelChange,
  openPopup,
  handleDragStart,
  handleDragOver,
  handleDrop,
}) => {
  if (!graphData) return <p>Table will be displayed here after uploading a file.</p>;

  const clusters = graphData.nodeDataArray.filter((node) => node.category === "system");
  const objects = graphData.nodeDataArray.filter((node) => node.category === "object");
  const attributes = graphData.nodeDataArray.filter((node) => node.category === "attribute");

  const rows = attributes.map((attr) => {
    const parentObject = objects.find((obj) =>
      graphData.linkDataArray.some((link) => link.from === obj.key && link.to === attr.key)
    );

    const parentCluster = parentObject
      ? clusters.find((sys) =>
          graphData.linkDataArray.some((link) => link.from === sys.key && link.to === parentObject.key)
        )
      : null;

    return (
      <tr key={attr.key}>
        <td
          style={{ border: "1px solid black", padding: "5px" }}
          draggable
          onDragStart={(e) => handleDragStart(e, "cluster", parentCluster?.key)}
          onDragOver={(e) => handleDragOver(e)}
          onDrop={(e) => handleDrop(e, "cluster", parentCluster?.key)}
        >
          {parentCluster?.label || "Unlinked"}
          <br />
          <input
            type="text"
            value={parentCluster?.hoverLabel || ""}
            onChange={(e) => handleLabelChange(e, parentCluster?.key)}
          />
          <button onClick={() => openPopup(parentCluster?.key, parentCluster?.hoverLabel || "")}>+</button>
        </td>
        <td
          style={{ border: "1px solid black", padding: "5px" }}
          draggable
          onDragStart={(e) => handleDragStart(e, "object", parentObject?.key)}
          onDragOver={(e) => handleDragOver(e)}
          onDrop={(e) => handleDrop(e, "object", parentObject?.key)}
        >
          {parentObject?.label || "Unlinked"}
          <br />
          <input
            type="text"
            value={parentObject?.hoverLabel || ""}
            onChange={(e) => handleLabelChange(e, parentObject?.key)}
          />
          <button onClick={() => openPopup(parentObject?.key, parentObject?.hoverLabel || "")}>+</button>
        </td>
        <td
          style={{ border: "1px solid black", padding: "5px" }}
          draggable
          onDragStart={(e) => handleDragStart(e, "attribute", attr.key)}
          onDragOver={(e) => handleDragOver(e)}
          onDrop={(e) => handleDrop(e, "attribute", attr.key)}
        >
          {attr.label}
          <br />
          <input
            type="text"
            value={attr.hoverLabel || ""}
            onChange={(e) => handleLabelChange(e, attr.key)}
          />
          <button onClick={() => openPopup(attr.key, attr.hoverLabel || "")}>+</button>
        </td>
      </tr>
    );
  });

  return (
    <table style={{ width: "100%", borderCollapse: "collapse" }}>
      <thead>
        <tr>
          <th style={{ border: "1px solid black", padding: "5px" }}>Cluster</th>
          <th style={{ border: "1px solid black", padding: "5px" }}>Object</th>
          <th style={{ border: "1px solid black", padding: "5px" }}>Attribute</th>
        </tr>
      </thead>
      <tbody>{rows}</tbody>
    </table>
  );
};

TableVisualization.propTypes = {
  graphData: PropTypes.object.isRequired,
  handleLabelChange: PropTypes.func.isRequired,
  openPopup: PropTypes.func.isRequired,
  handleDragStart: PropTypes.func.isRequired,
  handleDragOver: PropTypes.func.isRequired,
  handleDrop: PropTypes.func.isRequired,
};

export default TableVisualization;
